import React from 'react'
import "./Logs.css"
import data from "../data/sample.json"

export const Logs = ({ ftype, flever, fsearch }) => {

    console.log(data)

    return (
        <div className='log-container'>
            <div className='log-heading'>
                <h1>Logs</h1>
            </div>
            <div className='logs'>
                {
                    data.map((log, index) => {
                        const handleshowMore = () => {

                            const logclick = document.getElementById('logclick')
                            if (logclick.style.display === "block") {
                                logclick.style.display = "none"
                            } else {
                                logclick.style.display = "block"
                            }
                        }
                        
                        if ((ftype === "All" || log.type === ftype) && (flever === "All" || log.level === flever) && (fsearch === "" || log.message.toLowerCase().includes(fsearch.toLowerCase())))  {
                            return (
                                <div className='log' key={index} onClick={handleshowMore}>
                                    <div className='log-heading'>
                                        <span className=''>{log.level}</span>
                                        <span>{log.timestamp}</span>
                                    </div>
                                    <div className='log-message'>
                                        <p>{log.message}</p>
                                    </div>
                                    <div className='log-info'>
                                        <span>Resource:</span>
                                        <span>{log.resource}</span>
                                        <span>|</span>
                                        <span>Commit:</span>
                                        <span>{log.commit}</span>
                                    </div>
                                    <div className='log-description'>
                                        <div><span>Trace Id:</span><span>{log.traceId}</span></div>
                                        <div><span>Trace Id:</span><span>{log.traceId}</span></div>
                                        <div><span>Trace Id:</span><span>{log.traceId}</span></div>
                                    </div>
                                </div>
                            )
                        }
                        return null
                    })
                }
                
            </div>
        </div>
    )
}
